var c = document.getElementById('c')
var v = document.getElementById('v')
var video = document.getElementById('video')
var game;
var gameLoaded = false;
var createOnLoaded = false;
var this_ , hand_arr = [],answer_arr = [],num =0
window.onload = function () {
    c.style.visibility="hidden";
    // setTimeout(()=>{
    //     c.style.visibility="visible";
    //     video.pause()
    // },3200)
    var gameConfig = {
        type: Phaser.AUTO,
        parent:'c',
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],addFlag = false;
        
        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this_= this
        video.play()
        this.bg = this.add.image(256,400,'bg1')    
        this.hand()

        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    update(){
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this.showHand()
        if(video.currentTime.toFixed(1) == 3.2 && num == 0){
            c.style.visibility="visible";
            video.pause()
            setTimeout(() => {
                this.bag()
                setTimeout(() => {
                    this.hand.visible = 1
                }, 400);
            }, 500);
            num = 1
        }
        if( answer_arr[0] == 'bag') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(256,400,'bg2')
            }, 500);
            answer_arr = []
        }

        if(video.currentTime.toFixed(1) == 8.8 && num == 1){
            c.style.visibility="visible";
            video.pause()
            setTimeout(() => {
                this.box()
            }, 500);
            num =2
        }

        if( answer_arr[0] == 'box') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(256,400,'bg3')

            }, 500);
            answer_arr = []
        }
        if(video.currentTime.toFixed(1) == 17.8 && num == 2 ){
            c.style.visibility="visible";
            video.pause()
            setTimeout(() => {
                this.bone()
            }, 500);
            num =3
        }
    }

    bag(){
        var letters = ['a','b','g']
        this.showWords(letters,{name:'words',x:256,y:580},'bag') 
    }
    box(){
        var letters = ['o','b','x']
        this.showWords(letters,{name:'words',x:256,y:580},'box') 
    }
    bone(){
        var zzc = this.add.image(0,0,'bg3').setOrigin(0,0).setDepth(5).setInteractive().setAlpha(0.001).once(
            'pointerdown',
            function (params) {
                this.showDownload()
            },this
        )
        var letters = ['o','b','n','e']
        this.showWords(letters,{name:'words',x:256,y:580},'bone') 
    }

    showWords(letters,words_bg,answer,callback){
        var rect = new Phaser.Geom.Rectangle(-100, -100, game.config.width+1000, game.config.height+1000);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.5;
        graphics1.setDepth(2);
        graphics1.fillRectShape(rect);
        var words_arr_c =  []
        var words_arr =  []
        var box_arr =  []
        var w_arr =  []
        var result = []
        var coordinate = {
            letter:{
                six:[
                    {
                        x:words_bg.x-80,
                        y:words_bg.y+10
                    },
                    {
                        x:words_bg.x,
                        y:words_bg.y+10
                    },
                    {
                        x:words_bg.x+80,
                        y:words_bg.y+10
                    },
                    {
                        x:words_bg.x-80,
                        y:words_bg.y+90
                    },
                    {
                        x:words_bg.x,
                        y:words_bg.y+90
                    },
                    {
                        x:words_bg.x+80,
                        y:words_bg.y+90
                    },
                ],
                five:[],
                four:[
                    {
                        x:words_bg.x-40,
                        y:words_bg.y+10
                    },
                    {
                        x:words_bg.x+50,
                        y:words_bg.y+10
                    },
                    {
                        x:words_bg.x-40,
                        y:words_bg.y+90
                    },
                    {
                        x:words_bg.x+50,
                        y:words_bg.y+90
                    },
                ],
                three:[
                    {
                        x:words_bg.x-80,
                        y:words_bg.y+50
                    },
                    {
                        x:words_bg.x,
                        y:words_bg.y+50
                    },
                    {
                        x:words_bg.x+80,
                        y:words_bg.y+50
                    },
                ]
            },
            box:{
                six:[
                    {
                        x:words_bg.x-163,
                        y:words_bg.y-100
                    },
                    {
                        x:words_bg.x-98,
                        y:words_bg.y-100
                    },
                    {
                        x:words_bg.x-33,
                        y:words_bg.y-100
                    },
                    {
                        x:words_bg.x+32,
                        y:words_bg.y-100
                    },
                    {
                        x:words_bg.x+97,
                        y:words_bg.y-100
                    },
                    {
                        x:words_bg.x+162,
                        y:words_bg.y-100
                    },
                ],
                five:[],
                four:[
                    {
                        x:words_bg.x-98,
                        y:words_bg.y-100
                    },
                    {
                        x:words_bg.x-33,
                        y:words_bg.y-100
                    },
                    {
                        x:words_bg.x+32,
                        y:words_bg.y-100
                    },
                    {
                        x:words_bg.x+97,
                        y:words_bg.y-100
                    },
                ],
                three:[
                    {
                        x:words_bg.x-80,
                        y:words_bg.y-80
                    },
                    {
                        x:words_bg.x,
                        y:words_bg.y-80
                    },
                    {
                        x:words_bg.x+80,
                        y:words_bg.y-80
                    },
                ]
            }
        }
        switch (letters.length) {
            case 6:
                var letter = coordinate.letter.six
                var box = coordinate.box.six
                break;
            case 5:
                
                break;
            case 4:
                var letter = coordinate.letter.four
                var box = coordinate.box.four
                break;
            case 3:
                var letter = coordinate.letter.three
                var box = coordinate.box.three
                break;
            default:
                break;
        }
        this.words_bg = this.add.image(words_bg.x,words_bg.y,words_bg.name).setDepth(2).setScale(0,0)
        this.tweens.add({
            targets:[this.words_bg],
            scaleX:1,
            scaleY:1,
            duration:200,
            onComplete:()=>{
                showletter(callback)
            }
        })
        var showletter = (callback) => {
            for(var i = 0;i<letters.length;i++){
                words_arr_c[i] = this.add.image(letter[i].x,letter[i].y,letters[i]+letters[i]).setDepth(2)
            }
            for(var i = 0;i<letters.length;i++){
                words_arr[i] = this.add.image(letter[i].x,letter[i].y,letters[i]).setDepth(2).setInteractive().on('pointerdown',function(){
                    this.visible = 0
                    result.push(this.texture.key)
                    hand_arr = result
                    var  index
                    for(let i = 0;i < result.length; i++){
                        if(result[i] == this.texture.key){
                            index = i
                        }
                    }
                    var this_l = this
                    w_arr[index] = this_.add.image(box[index].x,box[index].y,this.texture.key+ '1').setDepth(3).setInteractive().on('pointerdown',function(){
                        if(w_arr.indexOf(this) == w_arr.length-1){
                            this_l.visible = 1
                            this.destroy()
                            w_arr.pop()
                            result.pop()
                        }
                    })
                    if(result.length == answer.length){
                        if(result.join('') == answer){
                            answer_arr.push(answer)
                            for (let i = 0; i < w_arr.length; i++) {
                                w_arr[i].setTint(0x00FF00)
                                var a = w_arr[i]
                                this_.tweens.add({
                                    targets:[a],
                                    visible : 1,
                                    duration:50,
                                })
                                this_.tweens.add({
                                    targets:[a],
                                    visible : 1,
                                    delay:50,
                                    duration:50,
                                })
                                this_.tweens.add({
                                    targets:[a],
                                    visible : 0,
                                    delay:100,
                                    duration:50,
                                })
                                this_.tweens.add({
                                    targets:[a],
                                    visible : 1,
                                    delay:150,
                                    duration:50,
                                })
                                setTimeout(() => {
                                    w_arr[i].destroy()
                                    box_arr[i].destroy()
                                }, 500);
                                        
                            }
                            setTimeout(() => {
                                for (let j = 0; j < words_arr.length; j++) {
                                    words_arr[j].destroy()
                                    words_arr_c[j].destroy()
                                }
                                this_.words_bg.destroy()
                                graphics1.destroy()
                                this_.hand.visible = 0
                            }, 500);
                            if(callback){
                                setTimeout(() => {
                                    eval(callback+'()')
                                }, 500);
                            }
                            
                        }else{
                            for (let i = 0; i < w_arr.length; i++) {
                                w_arr[i].setTint(0xDC143C)
                                var a = w_arr[i]
                                this_.tweens.add({
                                    targets:[a],
                                    visible : 0,
                                    duration:50,
                                })
                                this_.tweens.add({
                                    targets:[a],
                                    visible : 1,
                                    delay:50,
                                    duration:50,
                                })
                                this_.tweens.add({
                                    targets:[a],
                                    visible : 0,
                                    delay:100,
                                    duration:50,
                                })
                                this_.tweens.add({
                                    targets:[a],
                                    visible : 1,
                                    delay:150,
                                    duration:50,
                                })
                            }
                            setTimeout(() => {
                                for (let j = 0; j < w_arr.length; j++) {
                                    w_arr[j].destroy()
                                }
                                for (let j = 0; j < words_arr.length; j++) {
                                    words_arr[j].visible = 1                                        
                                }
                                w_arr = []
                                hand_arr = result =[]
                            }, 200);
                        }
                    }
                })
            }
            for(var i = 0; i<letters.length; i++){
                box_arr[i] = this.add.image(box[i].x,box[i].y,'box').setDepth(2)
            }
        }
    }
    showDownload() {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.2;
        graphics1.setDepth(8);
        graphics1.fillRectShape(rect);
        var win_bg = this.add.image(256, -400, 'nice').setDepth(10)
        var down = this.add.image(256, 520, 'continue').setDepth(10).setScale(0, 0).setInteractive().on('pointerdown', () => {
            landingPage()
        })
        this.tweens.add({
            targets: [win_bg],
            y: 400,
            duration: 800,
            ease: 'Back',
            onComplete: () => {
                this.tweens.add({
                    targets: [down],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 500,
                    onComplete: () => {
                        landingPage()
                        setInterval(() => {
                            this.tweens.add({
                                targets: [down],
                                scaleX: 1.1,
                                scaleY: 1.1,
                                duration: 300,
                                onComplete: () => {
                                    this.tweens.add({
                                        targets: [down],
                                        scaleX: 1,
                                        scaleY: 1,
                                        duration: 300,
                                        onComplete: () => {

                                        }
                                    })
                                }
                            })
                        }, 600);

                    }
                })
            }
        })
    }
    hand(){
        this.hand = this.add.image(-100,0,'hand').setDepth(10).setOrigin(0.3,0.1).setVisible(0)
        setInterval(() => {
            this.tweens.add({
                targets:[this.hand],
                scaleX:0.9,
                scaleY:0.9,
                duration:300,
                onComplete:()=>{
                    this.tweens.add({
                        targets:[this.hand],
                        scaleX:1,
                        scaleY:1,
                        duration:300,
                        onComplete:()=>{
                        }
                    })
                }
            })
        }, 600);
    }
    showHand(){
        
        if(hand_arr.length == 0){
            this.hand.x = 256
            this.hand.y = 630
        }
        if(hand_arr[hand_arr.length-1] == 'b'){
            this.hand.x = 176
            this.hand.y = 630
        }
        if(hand_arr[hand_arr.length-1] == 'a'){
            this.hand.x = 336
            this.hand.y = 630
        }
        
    }
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
            v.style.width = windowWidth + "px";
            v.style.height = (windowWidth / gameRatio) + "px";
            c.style.width = windowWidth + "px";
            c.style.height = (windowWidth / gameRatio) + "px";
        }
        else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
            v.style.width = (windowHeight * gameRatio) + "px";
            v.style.height = windowHeight + "px";
            c.style.width = (windowHeight * gameRatio) + "px";
            c.style.height = windowHeight + "px";
        }
    }
}

var assets = {"aa": "data:image/png;base64,", "ee": "data:image/png;base64,", "box": "data:image/png;base64,", "gg": "data:image/png;base64,", "xx": "data:image/png;base64,", "b1": "data:image/png;base64,", "bb": "data:image/png;base64,", "nn": "data:image/png;base64,", "bg1": "data:image/jpeg;base64,", "bg2": "data:image/jpeg;base64,", "bg3": "data:image/jpeg;base64,", "o1": "data:image/png;base64,", "nice": "data:image/png;base64,", "a": "data:image/png;base64,", "g1": "data:image/png;base64,", "hand": "data:image/png;base64,", "a1": "data:image/png;base64,", "words": "data:image/png;base64,", "n1": "data:image/png;base64,", "x1": "data:image/png;base64,", "e1": "data:image/png;base64,", "oo": "data:image/png;base64,", "b": "data:image/png;base64,", "e": "data:image/png;base64,", "g": "data:image/png;base64,", "o": "data:image/png;base64,", "n": "data:image/png;base64,", "continue": "data:image/png;base64,", "x": "data:image/png;base64,"}